export class EmployeeDetailComponent {
  constructor(employeeService, projectService, taskService, route) {
    this.employeeService = employeeService;
    this.projectService = projectService;
    this.taskService = taskService;
    this.route = route;
    this.totalPagesProject = 0;
    this.modalClass = "modal";
    this.employeeForm = new FormGroup({
      firstName: new FormControl(),
      lastName: new FormControl(),
      company: new FormControl(),
      jobTitle: new FormControl(),
      bussinessPhone: new FormControl(),
      homePhone: new FormControl(),
      mobilePhone: new FormControl(),
      faxNumber: new FormControl(),
      street: new FormControl(),
      city: new FormControl(),
      state: new FormControl(),
      zip: new FormControl(),
      country: new FormControl(),
      emailAddress: new FormControl()
    });
  }

  ngOnInit() {
    this.route.paramMap.subscribe(data => {
      this.id = data.params["id"];
      this.getEmployee(data.params["id"]);
      this.getProjects(data.params["id"], 0);
      this.getTasks(data.params["id"]);
      this.init();
    });
